description:
राष्ट्रपति रामचन्द्र पौडेल समक्ष राष्ट्रिय सभा सदस्य निर्वाचनको प्रतिवेदन पेश भएको छ ।&amp;nbsp;

राष्ट्रपति भवन शीतल निवासमा बुधबार आयोजित कार्यक्रममा कार्यवाहक प्रमुख निर्वाचन आयुक्त रामप्रसाद भण्डारीले प्रतिवेदन पेश गरेका हुन् ।&amp;nbsp;

यही माघ

नेपाली बजारमा आज पनि सुनचाँदीको मूल्यले कीर्तिमान कायम गरेको छ ।&amp;nbsp;

नेपाल सुनचाँदी व्यवसायी महासङ्घका अनुसार आज एक तोला छापावाल सुनको मूल्य तीन लाख १८ हजार ८०० त्यति नै चाँदीको मोल सात हजार ३०० कायम भएको छ ।&amp;nbsp;

मङ्गलबार एक तोला छापावा

राष्ट्रिय स्वतन्त्र पार्टीका सभापति रवि लामिछाने काठमाडौंको महाराजगञ्जस्थित त्रिवि शिक्षण अस्पतालमा उपचार भैरहेको छ ।&amp;nbsp;

हाल उनको स्वास्थ्य अवस्था सामान्य रहेको अस्पतालले जनाएको छ ।

अस्पतालद्वारा जारी प्रेस विज्ञप्तिअनुसार लामिछाने माघ ५ गते

विमान दुर्घटनामा भारतको महाराष्ट्रका उपमुख्यमन्त्री अजित पवारको निधन भएको छ।

नागरिक उड्डयन महानिर्देशनालयले पवारको निधन भएको पुष्टि गरेको समाचार एजेन्सी पीटीआईले जनाएको छ ।&amp;nbsp;

उनी सवार विमान बुधबार बिहान बारामतीमा दुर्घटनाग्रस्त भएको थियो ।

विभिन्न कार्यक्रमको आयोजना गरी आज सम्पत्ति शुद्धीकरण निवारण राष्ट्रिय दिवस मनाइँदैछ ।&amp;nbsp;

सम्पत्ति शुद्धीकरण अनुसन्धान विभागका अनुसार आज अर्थमन्त्री रामेश्वर खनालको उपस्थितिमा राष्ट्रिय दिवस मनाउन लागिएको हो ।&amp;nbsp;

